import React, {useState} from 'react';


function AboutMe() {
	const styles = StyleSheet.create({
		fieldSet:{
			margin: 10,
			paddingHorizontal: 10,
			paddingBottom: 10,
			borderRadius: 5,
			borderWidth: 1,
			alignItems: 'center',
			borderColor: '#000'
		},
		legend:{
			position: 'absolute',
			top: -10,
			left: 10,
			fontWeight: 'bold',
			backgroundColor: '#FFFFFF'
		}
	});

	return(
		<div>
			<h2>Donghyun Kim</h2>
			<fieldset>
				<h3>Professional Profile</h3>
				<View style={styles.fieldSet}>
    <Text style={styles.legend}>Heading</Text>
    <Text>Some Text or control</Text>
</View>
				<ul>
					<li>	Good research skill including identifying when research is required.</li>
				</ul>
			</fieldset>
		</div>
	);
}

export default AboutMe;
